    return(
        <div className="Header">
            <div className="rerollButton">
                <h1>Who...</h1>
                <h2>{props.scenario}</h2>
            </div>
            <div className="rerollButton">
                <input type="button" value="reroll" />
            </div>
        </div>
    )
}

export default Header
